import React from 'react'
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';

function Carausel() {
    return (
        <>
            <Carousel slides={[
          (<div>1</div>),
          (<div>2</div>),
          (<div>3</div>),
        ]}/>
            
        </>
    )
}

export default Carausel
